import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentDidMount(){
        console.log("i am mounted");
        const url = "http://www.localhost:8000/tennis/";
        fetch(url, {
            // mode: 'no-cors',
            method: 'GET',
            headers: {
              Accept: 'application/json',
            },
          },
        )
        .then(response => {
        if (response.ok) {
        response.json().then(json => {
        console.log(json);
        this.setState({tournaments:json});
        });
        }
        });
    }


    render() {  
        const tournamentItems= [...new Set(this.state.tournaments.map(item => item.event_name))];  
        const tournamentDivItems=tournamentItems.map(item => <div>{item}</div>);
        return <div>{tournamentDivItems}</div>;
    }

}
